package com.leetcode

import kotlin.test.Test
import kotlin.test.expect

class LongestSubstringWithoutRepeatingCharactersTest {

    @Test
    fun `empty string`() {
        expect(0) { lengthOfLongestSubstring("") }
    }

    @Test
    fun `same character only`() {
        expect(1) { lengthOfLongestSubstring("bbbbbb") }
    }

    @Test
    fun `abcabcbb`() {
        expect(3) { lengthOfLongestSubstring("abcabcbb") }
    }

    @Test
    fun `pwwkew`() {
        expect(3) { lengthOfLongestSubstring("pwwkew") }
    }

    @Test
    fun `string with one space`() {
        expect(1) { lengthOfLongestSubstring(" ") }
    }

    @Test
    fun `au`() {
        expect(2) { lengthOfLongestSubstring("au") }
    }

    @Test
    fun `auaaaaaaertertposteza`() {
        expect(2) { lengthOfLongestSubstring("au") }
    }

    @Test
    fun `time limit exceeded bug`() {
        expect(95) { lengthOfLongestSubstring("abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\"#\$%&'()*+,-./:;<=>?@[\\]^_`{|}~ abcdefghijklmno")}
    }

